def changeKeyWordsData(dict):

    list = []

    print(dict)
    # 查询 热搜排行数据 找到产品对应的关键词 数据 然后通过关键词 查找 直通车关键词表  及  流量来源表  获取对应日期的关键词汇总所需数据

    try:
        keyWordObjects = SearchRanklist.objects.filter(searchid=dict['searchid'], datetype='1').values('seipvuvhits', 'payrate', 'endtime', 'searchword')
    except Exception as err:
        print(err)
    print(keyWordObjects)


    for kObject in keyWordObjects:
        # 权重分
        WeightPoints = 0.0
        # 关键词
        Keywords = 0.0
        # 行业搜索人气
        IndustrySearchPopularity = 0.0
        # 行业转化
        IndustryTransformation = 0.0
        # 搜索访客
        VisitorsToSearch = 0.0
        # 搜索成交
        SearchClinchDeal = 0.0
        # 搜索转化
        SearchConversion = 0.0
        # 阿明转化
        MingConversion = 0.0
        # 竞品转化
        CompetingConversion = 0.0
        # 展现量
        ShowCount = 0.0
        # 点击
        Click = 0.0
        # 点击率
        Click_Rate = 0.0
        # 花费
        Spending = 0.0
        # PPC
        PPC = 0.0
        # 笔数
        TotalCount = 0.0
        # 转化
        Conversion = 0.0
        # 金额
        Amount = 0.0
        # ROI
        ROI = 0.0
        # UV价值
        UV = 0.0
        # 客单价
        GuestUnitPrice = 0.0
        # 行业转化权重
        IndustryConversionWeigh = 0.0
        # 搜索转化权重
        SearchConversionWeight = 0.0
        # 阿明转化权重
        MingConversionWeight = 0.0
        # 竞品转化权重
        CompetingConversionWeight = 0.0
        # 转化总分
        ConversionTotalScore = 0.0
        # 主商品
        MainP = ''
        # 搜索id
        searchId = ''

        print('****%s********%s' % (kObject['searchword'], kObject['endtime']))
        try:
            sourceObjet = Trafficsources.objects.filter(datetype='1', pagename=kObject['searchword'], endtime=kObject['endtime']).values('uv', 'paybyrcnt')
        except Exception as err:
            print(err)

        print('s---------%s' % sourceObjet)

        try:
            keyTrainObject = KeywordsPutonEffect.objects.filter(keywords=kObject['searchword'], date=kObject['endtime']).values('clickquantity', 'cost', 'clickrate', 'totalclinchdealcount', 'totalclinchdealmoney', 'roi', 'clickconversion', 'showamount')
        except Exception as err:
            print(err)


        print('k-------------%s' % keyTrainObject)

        MainP = dict['productname']
        searchId = dict['searchid']
        if len(sourceObjet) > 0:
            for so in sourceObjet:
                VisitorsToSearch += float(so['uv'])
                SearchClinchDeal += float(so['paybyrcnt'])

        SearchConversion = SearchClinchDeal if VisitorsToSearch <= 0 else SearchClinchDeal / VisitorsToSearch
        IndustrySearchPopularity = float(kObject['seipvuvhits'])
        IndustryTransformation = float(kObject['payrate'])

        if len(keyTrainObject) > 0:
            for ko in keyTrainObject:
                # ko = list(kto)
                ShowCount += float('0.0' if len(ko['showamount']) <= 0 else ko['showamount'])
                Click += float('0.0' if len(ko['clickquantity']) <= 0 else ko['clickquantity'])
                Spending += float('0.0' if len(ko['cost']) <= 0 else ko['cost'])
                TotalCount += float('0.0' if len(ko['totalclinchdealcount']) <= 0 else ko['totalclinchdealcount'])
                Amount += float('0.0' if len(ko['totalclinchdealmoney']) <= 0 else ko['totalclinchdealmoney'])

        Click_Rate = Click if ShowCount <= 0.0 else Click/ShowCount
        Conversion = TotalCount if Click <= 0.0 else TotalCount/Click
        ROI = Amount if Spending <= 0.0 else Amount/Spending
        PPC = Click if Click <= 0.0 else Spending/Click
        UV = GuestUnitPrice * Conversion
        GuestUnitPrice = TotalCount if TotalCount <= 0.0 else Amount/TotalCount
        IndustryConversionWeigh = IndustryTransformation * IndustryTR
        SearchConversionWeight = SearchConversion * SearchPeopleTR
        MingConversionWeight = MingConversion * SearchCountTR
        CompetingConversionWeight = CompetingConversion * CompetingGoodsTR
        ConversionTotalScore = IndustryConversionWeigh + SearchConversionWeight + MingConversionWeight + CompetingConversionWeight
        WeightPoints = '0.0' if SearchConversion < 0.01 else (ConversionTotalScore * IndustrySearchPopularity)

        newObject = models.Keywordssummary(
            datetime=kObject['endtime'], \
            weightpoints=str(WeightPoints), \
            keywords=kObject['searchword'],\
            industrysearchpopularity=str(int(IndustrySearchPopularity)), \
            industrytransformation=str(round(IndustryTransformation, 4)*100), \
            visitorstosearch=str(VisitorsToSearch), \
            searchclinchdeal=str(SearchClinchDeal), \
            searchconversion=str(round(SearchConversion, 4)*100), \
            mingconversion=str(MingConversion), \
            competingconversion=str(CompetingConversion), \
            click=str(Click), \
            click_rate=str(round(Click_Rate, 4)*100), \
            spending=str(int(Spending)), \
            ppc=str(PPC), \
            totalcount=str(TotalCount), \
            conversion=str(round(Conversion, 4)*100), \
            amount=str(Amount), \
            roi=str(ROI*100), \
            uv=str(round(UV, 2)), \
            guestunitprice=str(GuestUnitPrice), \
            industryconversionweight=str(round(IndustryConversionWeigh, 4)*100), \
            searchconversionweight=str(round(SearchConversionWeight, 4)*100), \
            mingconversionweight=str(round(MingConversionWeight, 4)*100), \
            competingconversionweight=str(round(CompetingConversionWeight, 4)*100), \
            conversiontotalscore=str(round(ConversionTotalScore, 4)*100), \
            productname=MainP, \
            searchid=searchId,
        )
        list.append(newObject)
    return list




