def getPrice(row):
    str1 = row[2]
    tmp = str1.split('\"')
    if row[1] == '删除关键词':
        return ['0', '0']
    elif row[1] == '添加关键词':
        li = ['0', '0']
        for i in range(len(tmp)):
            if '移动出价' in tmp[i]:
                li[0] = '0'
                li[1] = tmp[i+1]
            elif '自定义出价' in tmp[i]:
                li[0] = '0'
                li[1] = tmp[i+2]
        return li
    elif row[1] == '更新关键词' or row[1] == '更新关键词出价':
        l = ['0', '0']
        for i in range(len(tmp)):
            if '元更新为' in tmp[i]:
                if i == len(tmp)-1:
                    l[0] = '0'
                    l[1] = '0'
                else:
                    l[0] = tmp[i-1]
                    l[1] = tmp[i+1]
        return l
    else:
        return ['0', '0']



def matchingType(tmp):
    tmpstr=tmp[-1]

    if tmpstr=='精确':
        return '2'
    elif tmpstr=='广泛':
        return '1'
    else:
        return '0'


def changeType(type):

    if type=='更新关键词':
        return '1'
    elif type=='更新关键词出价':
        return '2'
    elif type=='添加关键词':
        return '3'
    elif type=='删除关键词':
        return '4'
    else:
        return '0'

def putPriceType(row):
    tmpstr=row[2]
    if row[1]=='删除关键词':
        return '0'
    elif row[1]=='添加关键词':
        if '移动出价' in tmpstr:
            return '2'
        elif '自定义出价' in tmpstr:
            return '3'
        else:
            return '0'
    elif row[1]=='更新关键词' or row[1]=='更新关键词出价':
        if '无线出价' in tmpstr:
            return '1'
        else:
            return '0'
    else:
        return '0'


